import React from "react";
import PSO2Logo from "../img/pso2logo.png";
import {
 Container
} from "reactstrap";

function Footer(props) {
	return (
		<Footer className="site-footer">
			<Container>
				<Row>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
					<Col>
						<img src={PSO2Logo} className="img-fluid" alt="pso2" />
					</Col>
				</Row>
			</Container>
		</Footer>
	);
}

export default Footer;
